// Create 25 X 25 Game board assign cell objects, can be randomize
function createBoard(randomize = false) {
  let newBoard = [];
  for (let i = 0; i < 25; i++) {
    newBoard.push([]);
  }
  for (let x = 0; x < newBoard.length; x++) {
    for (let y = 0; y < 25; y++) {
      if (randomize) {
        newBoard[x][y] =
          Math.random() > 0.5
            ? { coord: { x, y }, isAlive: true, neighbors: 0 }
            : { coord: { x, y }, isAlive: false, neighbors: 0 };
      } else {
        let cell = { coord: { x, y }, isAlive: false, neighbors: 0 };
        newBoard[x][y] = cell;
      }
    }
  }
  return newBoard;
}

